void dv_calc_mb_coordinates::thread_hdltv_gen() {
    const char* dump_tv = std::getenv("AP_WRITE_TV");
    if (!(dump_tv && string(dump_tv) == "on")) return;

    wait();

    mHdltvinHandle << "[ " << endl;
    mHdltvoutHandle << "[ " << endl;
    int ap_cycleNo = 0;
    while (1) {
        wait();
        const char* mComma = ap_cycleNo == 0 ? " " : ", " ;
        mHdltvinHandle << mComma << "{"  <<  " \"ap_rst\" :  \"" << ap_rst.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"ap_start\" :  \"" << ap_start.read() << "\" ";
        mHdltvoutHandle << mComma << "{"  <<  " \"ap_done\" :  \"" << ap_done.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ap_idle\" :  \"" << ap_idle.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ap_ready\" :  \"" << ap_ready.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"d_width\" :  \"" << d_width.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"d_difseg_size\" :  \"" << d_difseg_size.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"d_pix_fmt\" :  \"" << d_pix_fmt.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"chan\" :  \"" << chan.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"seq\" :  \"" << seq.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"slot\" :  \"" << slot.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"tbl_address0\" :  \"" << tbl_address0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"tbl_ce0\" :  \"" << tbl_ce0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"tbl_we0\" :  \"" << tbl_we0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"tbl_d0\" :  \"" << tbl_d0.read() << "\" ";
        mHdltvinHandle << "}" << std::endl;
        mHdltvoutHandle << "}" << std::endl;
        ap_cycleNo++;
    }
}

